import React from 'react';


const Cards = ({name,lastname,avatar,email,id}) => {
    return ( 
        <div className="col-md-4">
            <div className="col-md-4">
            <h3 className="card-header">{name} {lastname}</h3>
            <img className="card-header" src={avatar} alt=""/>
            <div>
            <button
            type="button" className="button3 button3-primario">Edit</button>
            <button
            type="button" className="button3 button3-primario">Show more</button>
            </div>

        </div>
        </div>
     );
}

export default Cards;
